	# ---------------- Imprimir Imagen ---------------------
	
	la a0, image2	# Imagen
	li a1,20		# Ancho
	li a2,20		# Alto
	li a3, 0		# Coordenada X
	li a4, 0		# Coordenada Y
	jal IMAGE
	
	# --------------- Convertir a Imagen Dinamica---------
	la a0, item		# ID
	li a1,0			# Coordenada X
	li a2,0			# Coordenada Y
	li a3,20			# Coordenada X'
	li a4,20			# Coordenada Y'
	jal NEW_IMAGE
	
	# ------------- Remover Imagen (Temporalmente)
	la a0, item
	jal REMOVE
	
	# Imprimir imagen
	la a0, image1		# Imagen
	li a1,200			# Ancho
	li a2,130			# Alto
	li a3,50			# Coordenada X
	li a4,50			# Coordenada Y
	jal IMAGE

