	li a1,50			# Coordenada X
	li a2,50			# Coordenada Y
	li a3,250			# Coordenada X'
	li a4,180			# Coordenada Y'
	jal NEW_IMAGE
	
	#------ Imprimimos Imagen ------
	la a0, item		# ID
	li a1, 80			# Coordenada X
	li a2, 80			# Coordenada Y
	jal CUT
	
